import React, {useState} from "react"
import Note from "./components/Note";

const App = () => {
    const [state, setState] = useState([
        {
            width: 200,
            height: 200,
            x: 0,
            y: 0
        }
    ]);

    return (
        <div style={{backgroundColor: "aqua", width: "100vw", height: '100vh'}}>
            <Note key={0}
                  state={state}
                  setState={setState}
            />
        </div>
    )
}


export default App
